import React from 'react';
import {connect} from 'react-redux';

export function MemoryPost(props){
  return(
    <li key={props.index} className={`${props.type.toLowerCase()} post`}>
      <h3>{props.title}</h3>
    </li>
  );
}

export default connect()(MemoryPost);
